import React, { useState } from 'react';
import Head from 'next/head';

import {
  Container,
  Jumbotron,
  Button,
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink
} from 'reactstrap';

import { FaDatabase } from 'react-icons/fa';
import 'bootstrap/dist/css/bootstrap.min.css';

function HomePage() {
   const [isOpen, setIsOpen] = useState(false);
   const toggle = () => setIsOpen(!isOpen);

    return (
        <div>
           <Head>
               <title>Home - Sillas Vinícius</title>
               <meta name="description" content="Portifólio Profissional do Sillas Vinícius Barbosa Braga" />
               <meta name="author" content="Sillas Vinícius" />
           </Head>
           <Navbar color="dark" dark expand="md" className="fixed-top">
               <Container>
                    <NavbarBrand href="/">Sillas Vinícius</NavbarBrand>
                    <NavbarToggler onClick={toggle} />
                    <Collapse isOpen={isOpen} navbar>
                        <Nav className="mr-auto" navbar>
                            <NavItem>
                                <NavLink href="/">Início</NavLink>
                            </NavItem>
                            <NavItem>
                                <NavLink href="/">Portifólio</NavLink>
                            </NavItem>
                        </Nav>
                    </Collapse>
                </Container>
           </Navbar>
           <Jumbotron fluid className="descr-top">
               <style>
                   {`
                       .descr-top {
                            background: linear-gradient(0deg, rgba(52,58,64,1) 0%, rgba(19,19,19,1) 83%);
                            color: #fff;
                            padding-top: 150px;
                            padding-bottom: 100px;
                            margin-bottom: 0rem !important;
                        }
                   `}
               </style>
                <Container className="text-center">
                    <h1 className="display-4 mb-4">Desenvolvedor Júnior!</h1>
                    <p className="lead mb-4">Quero trabalhar com os melhores   profissionais, aprender e aprofundar na área de TI, através do trabalho em  equipe e do convívio com pessoas qualificadas, buscando sempre evoluir.</p>
                    <p className="lead">
                        <Button outline color="info" size="lg">ENTRE EM CONTATO</Button>
                    </p>
                </Container>      
            </Jumbotron>
            <Jumbotron fluid className="servicos">
                <style>
                    {`
                        .servicos {
                            background: #fff;
                            padding-top: 80px;
                            padding-bottom: 80px;
                            margin-bottom: 0rem !important;
                        }

                        .circulo {
                            width: 140px;
                            height: 140px;
                            background-color: #17a2b8;
                            font-size: 52px;
                            padding-top: 24px;
                            color: #fff;
                        }

                        .centralizar {
                            margin: 0px auto !important;
                            float: none !important;
                        }
                    `}
                </style>
                <Container className="text-center">
                    <div>
                        <h2 className="display-4">Serviços</h2>
                        <p className="lead pb-4">No que posso te ajudar ?</p>
                    </div>
                    <div class="row">
                        <div class="col-lg-4">
                            <div className="rounded-circle circulo centralizar">
                                <FaDatabase />
                            </div>
                            <h2 className="mt-4 mb-4">Front-End</h2>
                            <p>Donec sed odio dui. Etiam porta sem malesuada magna mollis euismod. Nullam id dolor id nibh ultricies vehicula ut id elit. Morbi leo risus, porta ac consectetur ac, vestibulum at eros. Praesent commodo cursus magna.</p>
                        </div>
                        <div class="col-lg-4">
                            <div className="rounded-circle circulo centralizar"></div>
                            <h2 className="mt-4 mb-4" >Back-End</h2>
                            <p>Duis mollis, est non commodo luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit. Cras mattis consectetur purus sit amet fermentum. Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh.</p>
                        </div>
                        <div class="col-lg-4">
                            <div className="rounded-circle circulo centralizar">
                                <FaDatabase />
                            </div>
                            <h2 className="mt-4 mb-4" >Banco de Dados</h2>
                            <p>Donec sed odio dui. Cras justo odio, dapibus ac facilisis in, egestas eget quam. Vestibulum id ligula porta felis euismod semper. Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh, ut fermentum massa justo sit amet risus.</p>
                        </div>
                    </div>          
                </Container>
            </Jumbotron>
        </div>
    );
  }

  export default HomePage
